$(document).on("mousewheel DOMMouseScroll", '.canvas-container', function(e) {
    var delta = (e.originalEvent.wheelDelta && (e.originalEvent.wheelDelta > 0 ? 1 : -1)) || // chrome & ie
        (e.originalEvent.detail && (e.originalEvent.detail > 0 ? -1 : 1)); // firefox

    if (delta > 0) {
        // 向上滚 
        graph.canvasZoom += .1;
        graph.SetcanvasZoom(graph.canvasZoom);
    } else if (delta < 0) {
        // 向下滚
        if (graph.canvasZoom > .2) {
            graph.canvasZoom -= .1
        }
        graph.SetcanvasZoom(graph.canvasZoom);
    }
});

