var dragDate;


function _dragstart(event) {
    event = event.originalEvent;
    var $parent = $(event.target).parent();
    if ($parent.attr("data-type") == "svg" || $parent.attr("data-type") == "img") {
        dragDate = { src: $parent.attr("data-src"), type: $parent.attr("data-type"), crash: $parent.attr("data-crash"), name: $parent.attr("data-name") };
    } else if ($parent.attr("data-type") == "textObj" || $parent.attr("data-type") == "text") {
        dragDate = { text: $parent.attr("data-text"), color: $parent.attr("data-color"), type: $parent.attr("data-type"), name: $parent.attr("data-name") };
    }
};

function _drop(event) {

    event = event.originalEvent;
     console.log(event.clientX,event.layerX,graph.canvas)
    event.preventDefault();
    var data = dragDate;
    if (data.type == "svg" || data.type == "img") {
        var obj = {
            genre: data.type,
            id: graph.randId("obj"),
            left: (event.layerX - (1 - graph.canvasZoom) * graph.zoomPoint.x) / graph.canvasZoom,
            top: (event.layerY - (1 - graph.canvasZoom) * graph.zoomPoint.y) / graph.canvasZoom,
            shape: {
                source: data.src,
                crashPath: defaults.crashPath[data.crash],
                fill: defaults.object.shape.fill,
            },
            title: {
                text: data.name,
            },
        }
    } else if (data.type == "textObj") {

        var obj = {
            genre: data.type,
            id: graph.randId("obj"),
            left: (event.layerX - (1 - graph.canvasZoom) * graph.zoomPoint.x) / graph.canvasZoom,
            top: (event.layerY - (1 - graph.canvasZoom) * graph.zoomPoint.y) / graph.canvasZoom,
            shape: {
                text: data.text,
                fill: data.color,
                fontsize: 24,
                fill: "#fff",
                strokeWidth: 1,
                stroke: "#09c",
                fontWeight: 'bold'

            },
            container: {
                show: true,
                shape: 'ellipse'
            },
            title: {
                text: data.name,
            },
        }
    } else if (data.type == "text") {
        var text = {
            genre: data.type,
            id: graph.randId("text"),
            left: (event.layerX - (1 - graph.canvasZoom) * graph.zoomPoint.x) / graph.canvasZoom,
            top: (event.layerY - (1 - graph.canvasZoom) * graph.zoomPoint.y) / graph.canvasZoom,
            text: data.text,

        }
        window[text.id] = graph.creatText(text);
        graph.addrecords();
        return false;
    }
    obj = graph.extend(true, {}, defaults.object, obj);
    window[obj.id] = graph.creatShape(obj);
    graph.addrecords();

    return false;

}

function _dragover(event) {
    event = event.originalEvent;
    event.preventDefault();
}






